import React from "react";

function Nav() {
  return (
    <>
    <nav>
      <div className="nav-wrapper">
      <a href="#" class="brand-logo">Google Books Search</a>
        <ul className="row">
          <li><a href="">Search</a></li>
          <li><a href="">Saved</a></li>
        </ul>
      </div>
    </nav>
  </>
  );
}

export default Nav;
